import { Router, Route } from "react-router-dom";

function Header() {
    return (
       <header className="header">
            <div className="header__logo"></div>
            <Router>
                <Route path="/" />
                <Route path='/sign-in' />
                <Route path='/sign-up'/>          
            </Router>
        </header>
    )
    }
export default Header;
